import React from 'react';

import { getHello } from '../fetcher'

class HomePage extends React.Component {

  constructor(props) {
    super(props)

    this.state = {
      hello: "",
    }
  }

  componentDidMount() {
    getHello().then(res => {
      console.log(res);
      this.setState({ hello: res })
    }) 
  }


  render() {

    return (
      <div>
        {this.state.hello}
      </div>
    )
  }

}

export default HomePage
